import React from 'react';
import "./Nav.css";
import { Link } from 'react-router-dom';

function Nav() {
    return (
        <nav>
            <h3>Yobetit</h3>
            <ul className="nav-links">
                <Link>
                    <li>Home</li>
                </Link>
                <Link>
                    <li>About</li>
                </Link>
                <Link>
                    <li>Login</li>
                </Link>
            </ul>
        </nav>
    );
}

export default Nav;
